import React, { Component, Fragment } from 'react';
import { Doughnut } from 'react-chartjs-2';
import {
  SectionWrapper,
  GroupWrapper,
  CategoryTitle,
  ChartWrapper,
  VisualWrapper,
  LedgendWrapper,
  LegendColorTextWrapper,
  LedgendItem,
  LegendColor
} from './SectionData.styled.js';

class SectionData extends Component {

  renderDonutChart(dataSet) {
    const values = [];
    dataSet.forEach(value => {
      values.push(value.proportion);
    });

    const data = {
      datasets:
        [{
          data: values,
          backgroundColor: ['#02c7b0', '#607d8b', '#30a200', '#013d40', '#006567', '#008f91', '#00afb1', '#00ce5f', '#00e833', '#01ff39#' ],
          borderWidth: 0,
        }],
    }
    const options = {
      maintainAspectRatio: false,
      cutoutPercentage: 80,
      events: [],
    }

    return (
      <Doughnut
        data={data}
        options={options}
        width={200}
        height={200}
      />
    )
  }

  renderLegend(dataSet) {
    const values = [];
    dataSet.forEach(value => {
      values.push(value.title);
    });

    return (
      <Fragment>
        {values.map(title => (
          <Fragment>
            <LegendColor />
            <LedgendItem color={"pink"}>{title}</LedgendItem>
          </Fragment>
        ))}
      </Fragment>
    );
  }

  render() {
    return (
      <SectionWrapper>
        <GroupWrapper>
          <CategoryTitle>{this.props.category}</CategoryTitle>
          <ChartWrapper>
            <LedgendWrapper>
              {this.renderLegend(this.props.brokerData)}
            </LedgendWrapper>
            <VisualWrapper>
              {this.renderDonutChart(this.props.brokerData)}
            </VisualWrapper>
          </ChartWrapper>
        </GroupWrapper>
        <GroupWrapper>
          <CategoryTitle>{this.props.category}</CategoryTitle>
          <ChartWrapper>
            <LedgendWrapper>
              {this.renderLegend(this.props.carrierData)}
            </LedgendWrapper>
            <VisualWrapper>
            {this.renderDonutChart(this.props.carrierData)}
            </VisualWrapper>
          </ChartWrapper>
        </GroupWrapper>
      </SectionWrapper>
    );
  }
}

export default SectionData;
